import { NavLink } from "react-router-dom";

export function Navbar() {
  return (
    <nav style={{ background: "#1e1e1e", padding: "1rem" }}>
      <ul style={{ 
          display: "flex", 
          gap: "1.5rem", 
          listStyle: "none", 
          margin: 0, 
          padding: 0 
      }}>
        <li>
          <NavLink
            to="/"
            style={({ isActive }) => ({
              color: isActive ? "yellow" : "white",
              textDecoration: "none",
              fontWeight: isActive ? "bold" : "normal"
            })}
          >
            Home
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/Page1"
            style={({ isActive }) => ({
              color: isActive ? "yellow" : "white",
              textDecoration: "none",
              fontWeight: isActive ? "bold" : "normal"
            })}
          >
            Page 1
          </NavLink>
        </li>
      </ul>
    </nav>
  );
}
